package main

func main() {
	var instructions [5]string

	instructions[0] = ""
	instructions[1] = ""
	instructions[2] = ""
	instructions[3] = ""
	instructions[4] = ""

	keypad := NewKeypad()
	actualKeypad := NewActualKeypad()

	var unlockCombination string
	var actualUnlockCombination string

	for _, instruction := range instructions {
		for _, direction := range instruction {
			keypad.Move(string(direction))
			actualKeypad.Move(string(direction))
		}

		unlockCombination += keypad.GetTargetButton()
		actualUnlockCombination += actualKeypad.GetTargetButton()
	}

	println("Combination: " + unlockCombination)
	println("Actual Combination: " + actualUnlockCombination)
}
